import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Header from "./components/Header";

function AppRouter() {
    return (
        <BrowserRouter>
            <Header />
            <Routes>
                <Route path="/main" element={<Main />} />
            </Routes>
        </BrowserRouter>
    )
}

export default AppRouter;
